import React from "react";

const Home = () => {
  return (
    <>
      <div>
        <h1>short</h1>
        <p>
          Welcome to the book tracker app! You can add books you have read, or
          would like to read. You can add reviews and rate books based on how
          you liked them!
        </p>
        <img
          alt="flower and books"
          src="https://images.unsplash.com/photo-1498906538030-8da82e61e424?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8MzV8fGJvb2tzfGVufDB8MHwwfHw%3D&auto=format&fit=crop&w=500&q=60"
        />
      </div>
    </>
  );
};

export default Home;
